import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Calendly from "../components/Calendly";
import classes from "../styles/Schedule.module.css";

export default function Login() {

  const myStyle = {
    backgroundImage: "url(" +
        "https://images.pexels.com/photos/1353938/pexels-photo-1353938.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1.jpg" + ")",
    backgroundSize: 'cover',
    alt: 'Photo by Min An from Pexels',
  };

  return (
    <div>
      <Navbar />
      <div className={classes.scheduleContainer} style={myStyle}>
        <h1>Schedule Consultation</h1>
      <Calendly />
      </div>
      <Footer />
    </div>
  )
}
